import React from "react";

const Footer = () => {
  return (
    <footer class="footer text-center">
            <div class="container">
                <div class="row">
                    <div class="col-lg-4 mb-5 mb-lg-0">
                    </div>
                    <div class="col-lg-4 mb-5 mb-lg-0">
                        <h4 class="text-uppercase mb-4">Location</h4>
                        <p class="lead mb-0">
                            Maynooth University 
                            <br />
                            Women in Stem Society
                        </p>
                    </div>
                    <div class="col-lg-4">
                    </div>
                </div>
            </div>
        </footer>
  );
};

export default Footer;
